import './App.css';
import React from 'react';
import juices from './data'
import CardJuice from './components/CardJuice';

class App extends React.Component {
  render () {
    return (
      <>
        <h1> Que suco foi esse? </h1> 
        <CardJuice juice = {juices[0]}/>
      </>
    );
  }
}

export default App;
